import React from "react";
import { Box } from "@material-ui/core";

function AvatarIcon() {
    return (
        <Box 
            sx={{
                height: '30px',
                width: '30px'
            }}
            component='img'
            src='/vectors/man.png'
            alt='avatar_logo'
        />
    )
}

export default AvatarIcon;
